  const [showSearch, setShowSearch] = useState(false);

  const toggleSearch = () => {
    setShowSearch(!showSearch);
  };

  return (
    <>
      <Container>
        <h1>hello world</h1>
      </Container>
    </>
  );
};

export default Header;
